import '../css/general.css';
import '../css/header.css';
import '../css/uebersicht.css';
import Logo from './Logo.jsx';
import Navigation from './Navigation.jsx';
import Hamburger from './Hamburger.jsx';
import Content from './Content.jsx';
import Filter from './Filter.jsx';
import UebersichtContent from './UebersichtContent.jsx'
import React from 'react';
import {FilterScript2, hideShowTable} from '../js/uebersicht';


export default function Uebersicht() {

    return (    

        <div>
        <div id="topbar" className="topnav">

            <a href="/">
                <Logo name="logo"/>
            </a>

            <Navigation type="top"/>

            <Hamburger/>

        </div>
        <div id="mobilebar" className="sidenav">
            <Navigation type="mob"/>
        </div>
        <Filter/>

        <button className="hide_columns" onClick={()=>SpaltenScript()}>Spalte {'\u003E'}</button>
            <div id="checkboxes" className = "sidenav">
                <ul>
                    <li>
                        <h3 id="spaltenHeader">Spalten</h3>
                    </li>
                </ul>
            </div>

        <Content content = {<UebersichtContent/>}/>

        </div>
    )

}

function SpaltenScript() {
    const columns_btn = document.querySelector('.hide_columns');
    const checkboxes = document.querySelector('#checkboxes');
    const inner_frame = document.querySelector('#inner_frame');

    columns_btn.classList.toggle('is-active');
    checkboxes.classList.toggle('is-active');
    inner_frame.classList.toggle('is-active');

    columns_btn.firstChild.data = columns_btn.firstChild.data == "<" ? "Spalten >" : "<";
}
